import React,{useState} from 'react'
import {
    BrowserRouter as Router,
    Switch,
    Route
} from "react-router-dom"
import Header from "./components/header/Header";
import Products from "./components/products/Products"

function Function() {

    return (
        <Router>
            <Header/>
            <Switch>
                <Route path={"/products"}>
                    <Products/>
                </Route>
            </Switch>


        </Router>
    )
}

export default Function
